function Home() {
  return (
    <div>
      <h1>Welcome to the Home Page!</h1>
      <p>We are glad to have you here.</p>
      <p>Our web application was created to help pets find a loving home.</p>
      <p>Are you seeking a furry friend for life? Do you need to find a new home to a loved pet?.</p>
      <p>You are at the right place! Please check out our ads page.</p>
      <p>For more info, please check our about us page.</p>
    </div>
  );
}

export default Home;
